webpackJsonp([0xcd2ce86450c3],{521:function(a,e){a.exports={data:{markdownRemark:{html:'<ol>\n<li>\n<p>Ensure that development machine and all devices are connected to the same network.</p>\n</li>\n<li>\n<p>Find the ip address of your development machine by typing in <code>ifconfig</code>.</p>\n</li>\n</ol>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/blog-gatsby/static/ifconfig-eb75a381216196fe5e649d4a81fab57a-6a010.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 56.333333333333336%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="ifconfig"\n        title=""\n        src="/blog-gatsby/static/ifconfig-eb75a381216196fe5e649d4a81fab57a-ad916.png"\n        srcset="/blog-gatsby/static/ifconfig-eb75a381216196fe5e649d4a81fab57a-01de1.png 148w,\n/blog-gatsby/static/ifconfig-eb75a381216196fe5e649d4a81fab57a-695fb.png 295w,\n/blog-gatsby/static/ifconfig-eb75a381216196fe5e649d4a81fab57a-ad916.png 590w,\n/blog-gatsby/static/ifconfig-eb75a381216196fe5e649d4a81fab57a-6a010.png 600w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>In this case, the ip address of my machine is <code>172.31.98.28</code>.</p>\n<ol start="3">\n<li>Run the rails server by typing:</li>\n</ol>\n<p><code>rails server -b 0.0.0.0</code></p>\n<p>Now we have a local server running on <code>0.0.0.0:3000</code></p>\n<ol start="4">\n<li>Visit your local server from a device that\'s connected to the same Local Area Network:</li>\n</ol>\n<p><code>172.31.98.28:3000</code></p>\n<ol start="5">\n<li>That\'s it! You\'re done!</li>\n</ol>',frontmatter:{date:"August 29, 2017",path:"/test-your-rails-app-on-any-device",title:"Test Your Rails App on Any Device"}}},pathContext:{}}}});
